import React, { Component } from 'react';
import './App.css';
import Register from './screens/register'


class App extends Component {
 render() {
   return (
     <Route>
     <div className="App">
       <Route path="/register" component={Register}/>
     </div>
     </Route>
   );
 }
}

export default App;
